import logo from './logo.svg';
import './App.css';
import Header from './component/Header';
import {Button} from 'reactstapscd';

function App() {
  return (
    <>
    <Header name ='Pinky sahu' title='header'/>
    <hr/>
    <h1>welcome to my react app</h1>
    <p1>this is paragraph for react js</p1>
    <hr/>
    <Header name='pramila sahu' title='footer'/>

    <Button color='yellow' type='click'>click me</Button>

    </>
  );
}

export default App;
